// index.js
const cors = require("cors");
const express = require("express");
const Keycloak = require("keycloak-js");
const app = express();

// Add the cors middleware to handle CORS
app.use(cors());

const keycloak = new Keycloak({
  url: "http://localhost:8080/",
  realm: "ashahane",
  clientId: "myclient",
});

keycloak.init({ onLoad: "login-required" }).then((authenticated) => {
  if (authenticated) {
    ReactDOM.render(<App />, document.getElementById("root"));
  }
}).catch((error) => {
  console.error("Error during Keycloak initialization:", error);
});

// Your other routes and middleware should be added here
// ...

// Start the server
const port = 3001; // Change this to the port you want to use for your Keycloak Node.js app
app.listen(port, () => {
  console.log(`Keycloak server is running on http://localhost:${port}`);
});
